sources.components/Footer.js:
class Footer {
  render() {
    return `
            <div id="footer">
              <hr>
              <div class="footer-introduce">
                <p>重庆移通学院</p>
                <p>秃鸡队</p>
                <p>黄宣铭、刘程、柏凡</p>
              </div>
            </div>
        `;
  }
}

export default Footer;
